workflow FailingInSeveralWays {

	call WriteGreeting {
	  input:
	    greeting = "I like modifying strings"
	}

	call ReadItBackToMe {
		input:
			original_greeting = WriteGreeting.out
	}

	call WillFail {
	  input:
	    argument = ReadItBackToMe.outfile
	}

  scatter(idx in range(50)) {
    call ScatterJobThatWillFailSometimes {
      input:
        idx = idx
    }
  }

	output {
		File outfile = ReadItBackToMe.outfile
	}
}

task WriteGreeting {

	String greeting

	command {
		echo "${greeting}"
	}
	output {
		String out = read_string(stdout())
	}
}

task ReadItBackToMe {

	String original_greeting

	command {
		echo "${original_greeting} to you too"
	}
	output {
		File outfile = read_string(stdout())
	}
}

task WillFail {
  String argument

	command {
    exit 0;
	}
}
task ScatterJobThatWillFailSometimes {
  Int idx

  command {
    if [ "${idx}" -gt "40" ]; then
      exit 1;
    fi

    if [ "${idx}" -lt "20" ]; then
      exit 0;
    fi
  }
}
